import React, { Component, PropTypes } from 'react'; 
import Counter from './Counter';

const propTypes = { };
const defaultProps = { };

class App extends Component { 
    constructor(props) { 
        super(props)
    }

    render() {
        return(
            <div>
                <Counter/>
            </div>
        );
    }
}

App.propTypes = propTypes;
App.defaultProps = defaultProps;

export default App;
